import { IgrPolarBase } from "./igr-polar-base";
import { PolarScatterSeries } from "./PolarScatterSeries";
/**
 * Represents a IgxDataChartComponent polar scatter series.
*/
export class IgrPolarScatterSeries extends IgrPolarBase {
    createImplementation() {
        return new PolarScatterSeries();
    }
    /**
                                 * @hidden
                                 */
    get i() {
        return this._implementation;
    }
    constructor(props) {
        super(props);
    }
    /**
     * Gets whether the series has only marker as visuals
    */
    get hasOnlyMarkers() {
        return this.i.ei;
    }
}
